import Article1 from './Article/Article-1/Article';
import Article2 from './Article/Article-2/Article';
import Article3 from './Article/Article-3/Article';
import Article4 from './Article/Article-4/Article';

const Main = () => {
  return (
    <>
      <Article1 />
      <Article2 />
      <Article3 />
      <Article4 />
    </>
  );
};

export default Main;
